import myImage from '../data/img_snow_wide.jpg'
const carouselImages=[
    {
        img: myImage,
        desc: 'Legend 1',
    },
    {
        img: '../data/img_snow_wide.jpg',
        desc: 'Legend 2',
    },
    {
        img: '../data/img_snow_wide.jpg',
        desc: 'Legend 3',
    },
    {
        img: '../data/img_snow_wide.jpg',
        desc: 'Legend 4',
    },
    {
        img: '../data/img_snow_wide.jpg',
        desc: 'Legend 5',
    }
]

export default carouselImages;
